import axios from "axios";
import React from "react";

function Card() {
  async function Exec() {
    console.log("hello f2");
    try {
      console.log("hello f1");
      let r = await axios.get("http://localhost:2001/home");
      console.log(r);
    } catch (err) {
      console.log(err);
    }
  }

  Exec(); // Call the function directly

  return (
    <div>
      hello
    </div>
  );
}

export { Card };
